import React from "react";
import "../styles/Home.css"; // Import CSS file
import WallPaper from "../images/Home_WallPaper.png"

export default function Home() {
    return(
        <div class="container text-center">
            <div>
                <h1 class="text-center title">CLUEDO</h1>
            </div>
            <img class="img-fluid rounded shadow-sm" src={WallPaper} alt="WallPaper"/>

            <button type="button" class="btn btn-outline-secondary my-3">Start Game</button>

        </div>

    )
}
